import { MouseEvent, useState } from "react";
import styles from "./Login.module.css";
import { Link } from "react-router-dom";

const Login = () => {
    const [username, setUsername] = useState<string>('');
    const [password, setPassword] = useState<string>('');

    const handleSubmit = (ev: MouseEvent<HTMLButtonElement, globalThis.MouseEvent>): void => {
        ev.preventDefault();
    }

    return (
        <div className={styles.login}>
            <h2>Log Into The Social App</h2>
            <form className={styles.form}>
                <label>Username</label>
                <input
                    type="text"
                    onChange={(ev) => setUsername(ev.target.value)}
                    />
                <label>Password</label>
                <input 
                    type="password"
                    onChange={(ev) => setPassword(ev.target.value)}
                />
                <button onClick={(ev) => handleSubmit(ev)}>Log in</button>
            </form>
            <div className={styles.regLink}>Don't have an account? Register <Link to={'/register'}>here.</Link></div>
        </div>
    );
}

export default Login;
